void csr_mat_mul_test(int *row_ptr, int *col_idx, int8_t *data_arr) {
    int32_t row_A = 32, col_A;
    int32_t row_B = 1, col_B;
    int16_t output_data[ROWS_A * ROWS_B];
    int16_t *input_ptr, *output_ptr;
    int64_t *bias = NULL;
    Timer timer;
    timer.start();
    for (int i = 0; i < ROWS_B; i++) {
        col_A = col_B = (row_ptr[i + 1] - row_ptr[i]);
        int16_t input[row_A * col_A];
        int8_t weight[col_B];
        for (int j = row_ptr[i]; j < row_ptr[i + 1]; j++) {
            weight[j - row_ptr[i]] = data_arr[j];
            for (int k = 0; k < row_A; k++) {
                input[k * col_A + (j - row_ptr[i])] = input_data[k * COLS_A + col_idx[j]];
            }
        }
        input_ptr = input;
        output_ptr = output_data + i * row_B;
        for (int j = 0; j < row_A; j++) {
            arm_nn_vec_mat_mult_t_s16(input_ptr,
                                      weight,
                                      bias,
                                      output_ptr,
                                      0,
                                      0,
                                      col_B,
                                      row_B,
                                      INT16_MIN,
                                      INT16_MAX);
            input_ptr += col_A;
            output_ptr += ROWS_B;
        }
    }
    timer.stop();
    cout << "Execution time: " << timer.read_us() << "us\n";
    for (int i = 0; i < 20; i++) {
        cout << output_data[i] << ' ';
    }
    cout << "\n";
    for (int i = 0; i < 20; i++) {
        cout << output_data[ROWS_B * 28 + i] << ' ';
    }
    cout << "\n";
    return;
}
void Sparse_mat_mul_test(int *row_ptr, int *col_idx, int8_t *data_arr) {
    int32_t row_A = 32, col_A;
    int32_t row_B = 2, col_B;
    int16_t output_data[ROWS_A * ROWS_B];
    int16_t *input_ptr, *output_ptr;
    int64_t *bias = NULL;
    Timer timer;
    timer.start();
    for (int i = 0; i < row_ptr_len - 1; i++) {
        col_A = col_B = (row_ptr[i + 1] - row_ptr[i]);
        int16_t input[row_A * col_A] = {0};
        int8_t weight[row_B * col_B] = {0};
        for (int j = row_ptr[i]; j < row_ptr[i + 1]; j++) {
            int8_t data1 = data_arr[j * 2];
            int8_t data2 = data_arr[j * 2 + 1];
            weight[j - row_ptr[i]] = data1;
            weight[j - row_ptr[i] + col_B] = data2;
            for (int k = 0; k < row_A; k++) {
                input[k * col_A + (j - row_ptr[i])] = input_data[k * COLS_A + col_idx[j]];
            }
        }
        input_ptr = input;
        output_ptr = output_data + i * row_B;
        for (int j = 0; j < row_A; j++) {
            if (i != row_ptr_len - 2) {
                arm_nn_vec_mat_mult_t_s16(input_ptr,
                                          weight,
                                          bias,
                                          output_ptr,
                                          0,
                                          0,
                                          col_B,
                                          row_B,
                                          INT16_MIN,
                                          INT16_MAX);

            } else {
                arm_nn_vec_mat_mult_t_s16(input_ptr,
                                          weight,
                                          bias,
                                          output_ptr,
                                          0,
                                          0,
                                          col_B,
                                          1,
                                          INT16_MIN,
                                          INT16_MAX);
            }
            input_ptr += col_A;
            output_ptr += ROWS_B;
        }
    }
    timer.stop();
    cout << "Execution time: " << timer.read_us() << "us\n";
    for (int i = 0; i < 20; i++) {
        cout << output_data[i] << ' ';
    }
    cout << "\n";
    for (int i = 0; i < 20; i++) {
        cout << output_data[ROWS_B * 28 + i] << ' ';
    }
    cout << "\n";
    return;
}
void MCSR_mat_mul(int *row_ptr, int *col_idx, int8_t *data_arr) {
    int16_t output_data[ROWS_A * ROWS_B];
    int16_t *output_ptr = output_data;
    Timer timer;
    timer.start();
    for (int i = 0; i < ROWS_A; i++) {
        const int16_t *lhs = input_data + i * COLS_A;
        for (int j = 0; j < row_ptr_len - 1; j++) {
            const int32_t col_num = row_ptr[j + 1] - row_ptr[j];
            const int32_t col_loop_cnt = col_num / 2;
            const int8_t *rhs = data_arr + row_ptr[j] * 2;
            int32_t acc_0 = 0, acc_1 = 0;
            uint32_t vec_part = 0;
            for (int k = 0; k < col_loop_cnt; k++) {
                const int16_t *vec_part0 = (lhs + col_idx[row_ptr[j] + 2 * k]);
                const int16_t *vec_part1 = (lhs + col_idx[row_ptr[j] + 2 * k + 1]);
                vec_part = PKHBT((uint32_t)*vec_part0, (uint32_t)*vec_part1, 16);
                int32_t inA = arm_nn_read_s8x4_ia(&rhs);
                uint32_t inAbuf1 = SXTB16((uint32_t)inA);
                uint32_t inAbuf2 = SXTB16_RORn((uint32_t)inA, 8);
                acc_0 = SMLAD(inAbuf1, vec_part, acc_0);
                acc_1 = SMLAD(inAbuf2, vec_part, acc_1);
            }
            if (col_num & 0x1) {
                acc_0 += (*(lhs + col_idx[row_ptr[j + 1] - 1])) * (*rhs);
                rhs++;
                acc_1 += (*(lhs + col_idx[row_ptr[j + 1] - 1])) * (*rhs);
            }
            if ((ROWS_B & 0x1) && (j == row_ptr_len - 2)) {
                *output_ptr++ = (int16_t)acc_0;
            } else {
                *output_ptr++ = (int16_t)acc_0;
                *output_ptr++ = (int16_t)acc_1;
            }
        }
    }
    timer.stop();
    cout << "Execution time: " << timer.read_us() << "us\n";
    for (int i = 0; i < 20; i++) {
        cout << output_data[i] << ' ';
    }
    cout << "\n";
    for (int i = 0; i < 20; i++) {
        cout << output_data[ROWS_B * 28 + i] << ' ';
    }
    cout << "\n";
    return;
}
